-- ----------------------------
-- Table structure for `administrators`
-- ----------------------------
DROP TABLE IF EXISTS `administrators`;
CREATE TABLE `administrators` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `body_email` varchar(32) NOT NULL,
  `body_password` varchar(32) NOT NULL,
  `body_phone` varchar(11) NOT NULL DEFAULT '0' COMMENT '代理电话',
  `body_balance` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '代理账户余额',
  `body_transactions` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '代理交易额',
  `body_transactions_network` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '下线交易额',
  `body_bonus` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '累计盈利',
  `id_agent` int(20) NOT NULL DEFAULT '0' COMMENT '代理机构码 ，保证唯一性,默认是0，属于平台',
  `agent_name` varchar(100) NOT NULL DEFAULT '' COMMENT '代理名字',
  `type` int(3) NOT NULL DEFAULT '1' COMMENT '身份类型标识，0 表示管理员  1代理 ',
  `rate` int(3) NOT NULL DEFAULT '100' COMMENT '客户交易盈亏，代理承担的比率，100表示代理自负盈亏',
  `fee` int(3) NOT NULL DEFAULT '0' COMMENT '每笔交易的手续费比例，不能大于等于100',
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `deleted_at` datetime DEFAULT NULL COMMENT '软删除列',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;

